import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ClinicianProfile.css';

const ClinicianProfile = () => {
  const navigate = useNavigate();

  const handleClientClick = () => {
    // Hardcoded to navigate to Test User's profile
    navigate(`/patient-profile/testuser`);
  };

  return (
    <div className="clinician-profile">
      <h1>Clinician Profile</h1>
      <ul className="clients-list">
        <li className="client-item" onMouseDown={handleClientClick}>
          Test User DOB: 04/20/1969
        </li>
        {/* Add more patients here if needed */}
      </ul>
    </div>
  );
};

export default ClinicianProfile;
